    // toggle visibility of special messages
    function toggleMsg(messageType) {
        var chat = d.getElementById("chatinhalt");
        if(messageType !== "botMsg") {
            let msgs = chat.querySelectorAll("." + messageType);
            if(getValue("show" + messageType.ucFirst())) {
                Array.prototype.forEach.call(msgs,function(msg) {msg.classList.remove("hide")})
            } else {
                Array.prototype.forEach.call(msgs,function(msg) {msg.classList.add("hide")})
            }
        } else {
            Object.keys(bots).forEach(function(bot) {
                let msgs = chat.querySelectorAll("." + bot);
                if(!getValue("show" + messageType.ucFirst()) && getValue("filter" + bot.ucFirst())) {
                    Array.prototype.forEach.call(msgs,function(msg) {msg.classList.add("hide")})
                } else {
                    Array.prototype.forEach.call(msgs,function(msg) {msg.classList.remove("hide")})
                }
            });
        }
        chat.scrollTop = chat.scrollHeight;
    }

    // parse user nickname
    function loadNick(tries) {
        tries = tries || 0;
        setting.nick = "";
        var nickNodes = d.getElementsByClassName("nicknamenangabe");
        for(var i = 0; i < nickNodes.length; i++) {
            if(nickNodes[i].innerText.length > 0) {
                setting.nick = nickNodes[i].innerText;
                setting.initDone = true;
                GM_log("Hi " + setting.nick + "!");
                init();
                break;
            }
        }

        // workaround for guest nick, cause they load after document ready
        if(setting.nick.length === 0 && tries < 20) {
            setTimeout(function(){loadNick(tries++)},500);
        } else if (setting.nick.length === 0) {
            setting.nick = "failed to load";
            alert("Boost konnte deinen Namen nicht ermitteln und wird nicht korrekt funktionieren :(");
        }
    }

